`ifndef XIL_XECLIB
  always @ (trig_attr) begin
    #1;
    if ((attr_test == 1'b1) ||
        (ACTIVE_DUTYCYCLE_REG < 0.000 || ACTIVE_DUTYCYCLE_REG > 100.000)) begin
      $display("Error: [Unisim %s-101] ACTIVE_DUTYCYCLE attribute is set to %f.  Legal values for this attribute are 0.000 to 100.000. Instance: %m", MODULE_NAME, ACTIVE_DUTYCYCLE_REG);
      attr_err = 1'b1;
    end
    
    if ((attr_test == 1'b1) ||
        ((BFRTYPE_REG != "MATMULX") &&
         (BFRTYPE_REG != "INVALID"))) begin
      $display("Error: [Unisim %s-102] BFRTYPE attribute is set to %s.  Legal values for this attribute are MATMULX or INVALID. Instance: %m", MODULE_NAME, BFRTYPE_REG);
      attr_err = 1'b1;
    end
    
    if ((attr_test == 1'b1) ||
        (CLK_FREQ_REG < 0.000 || CLK_FREQ_REG > 1000.000)) begin
      $display("Error: [Unisim %s-103] CLK_FREQ attribute is set to %f.  Legal values for this attribute are 0.000 to 1000.000. Instance: %m", MODULE_NAME, CLK_FREQ_REG);
      attr_err = 1'b1;
    end
    
    if ((attr_test == 1'b1) ||
        ((EN_CLK_DOUBLER_REG < 0) || (EN_CLK_DOUBLER_REG > 1))) begin
      $display("Error: [Unisim %s-104] EN_CLK_DOUBLER attribute is set to %d.  Legal values for this attribute are 0 to 1. Instance: %m", MODULE_NAME, EN_CLK_DOUBLER_REG);
      attr_err = 1'b1;
    end
    
    if ((attr_test == 1'b1) ||
        ((NUM_COMPUTE_REG < 0) || (NUM_COMPUTE_REG > 8))) begin
      $display("Error: [Unisim %s-105] NUM_COMPUTE attribute is set to %d.  Legal values for this attribute are 0 to 8. Instance: %m", MODULE_NAME, NUM_COMPUTE_REG);
      attr_err = 1'b1;
    end
    
    if ((attr_test == 1'b1) ||
        ((NUM_MEMORY_REG < 0) || (NUM_MEMORY_REG > 8))) begin
      $display("Error: [Unisim %s-106] NUM_MEMORY attribute is set to %d.  Legal values for this attribute are 0 to 8. Instance: %m", MODULE_NAME, NUM_MEMORY_REG);
      attr_err = 1'b1;
    end
    
    if ((attr_test == 1'b1) ||
        ((XPA_CFG0_REG < 0) || (XPA_CFG0_REG > 65535))) begin
      $display("Error: [Unisim %s-107] XPA_CFG0 attribute is set to %d.  Legal values for this attribute are 0 to 65535. Instance: %m", MODULE_NAME, XPA_CFG0_REG);
      attr_err = 1'b1;
    end
    
    if (attr_err == 1'b1) #1 $finish;
  end
`endif


